settings.labelFunction:
var alarmStatus = data['alarm'];
if(alarmStatus == 'true'){
    return `<b style="font-size: 0.5rem;color: red">${data['entityName']}</b>`;
}
return `<b style="font-size: 0.5rem;color: blue">${data['entityName']}</b>`;

settings.tooltipFunction:
var alarmStatus = data['alarm'];
var consumption = parseInt(data['energyConsumption']);
if (alarmStatus == 'true') {
    return `<b style="color: red"> 
    <b>Reading: ${consumption} kwh <b/><br />
    <b> Status : Current reading is higher then thresholds(90 KWH)</b> <b></b>`;
} else if (consumption > 90) {
    return `<b style="color: blue"> 
    <b>Reading: ${consumption} kwh <b/>
    <br />
    <b> Status : Current reading is higher then thresholds(90 KWH)</b></b>`;
}
return `<b style="color: blue">
      <b>Reading: ${consumption} kwh <b/>
    <br />
  <b> Status: Normal </b>
  </b>`;

settings.colorFunction:
